import React from 'react';
import ReactDOM from 'react-dom';

import { BrowserRouter } from 'react-router-dom';

import './index.css';
import App from './App';
import Box3 from './App';
import reportWebVitals from './reportWebVitals';


const container = document.getElementById('root');
const root = ReactDOM.createRoot(container);


root.render(
  <React.StrictMode>
    <BrowserRouter>
      <App />
    </BrowserRouter>
  </React.StrictMode>
);

reportWebVitals();

// Box3 컴포넌트를 Box3라는 아이디를 가진 div에 렌더링하는 함수
function renderBox3() {
  const box3Element = document.getElementById('Box3');
  if (box3Element) {
    ReactDOM.render(
      <React.StrictMode>
        <Box3 />
      </React.StrictMode>,
      box3Element
    );
  }
}

document.addEventListener('DOMContentLoaded', renderBox3);

reportWebVitals();
